pragma solidity >=0.4.21 <0.6.0;
pragma experimental ABIEncoderV2;
import './MediaContract.sol';
import './PlaylistContract.sol';

contract RentalContract {
    //Import Contract
    PlaylistContract playlistContract;

    //Playlist 
    uint playlist_Id;

    //-----------------Rentail Profile-----------------//
    //Rental Status for Device Playing Status
    enum RentalStatus { Init, Processing, Failed, Finished, Refounded }
    RentalStatus enum_rentalstatus;

    //Rentail Mapping and Rental array
    mapping(uint => RentalData) public RentalStores;
    RentalData[] public RentalDataList;

    //Rental Id 
    uint RentalCount;
    struct RentalData{  
        uint RentalId;     // Rentail ID 
        address buyer;     // Account Buyer 
        address player;    // Account Player(Device)
        address system;    // Account System
        bool All_status;   // Check Media File, Buyer Wallet, Player Status
        bool refounded;    // Check Wallet Refound Status
        RentalStatus rental_status; // Check Rentail Status
        uint cost;         // Get Cost
        string start_time; // Get Start Time
        string end_time;   //Get End Time 
        uint playlistid; // Playlist ID (Name)
        uint Rentail_fee; // Rentail Fee 
    }
    //Rentail Event Parameter
    event RentalTask(uint id, bool All_status, RentalStatus rental_status);

    //----------------Add Playlist Contract Address----------------//
    function AddPlaylist(address playlistAddress) public{
        //Playlist Contract
        playlistContract = PlaylistContract(playlistAddress);
    }
   //----------------Add Playlist Contract Address----------------//


    //----------------Save Rentail Data----------------//
    function SaveRental(address _buyer, address _player, address _system, bool _playerStatus, uint _cost, string memory _startTime, string memory _endTime, uint _playlistId, uint _rental_fee) public{

        bool all_status = CheckStatus(_playlistId, _buyer, _playerStatus, _rental_fee);

        enum_rentalstatus = RentalStatus.Init;
        if(all_status==false){
           enum_rentalstatus = RentalStatus.Failed;
        }
        RentalData memory rental_file = RentalData(RentalCount, _buyer, _player, _system, all_status, false, enum_rentalstatus, _cost, _startTime, _endTime, _playlistId, _rental_fee);


        RentalStores[RentalCount] = rental_file; 

        RentalDataList.push(rental_file);
        RentalCount += 1;

        emit RentalTask(RentalCount-1, all_status, enum_rentalstatus);
    }
    //----------------Save Rentail Data----------------//

    //----------------Check Playlist, Buyer and Player is ready----------------//
    function CheckStatus(uint _playlistId, address _buyer, bool playerStatus, uint _rental_fee) public view returns (bool) {
        // Need to check media_status   
        bool _media_status = playlistContract.getplaylistStatus(_playlistId);
        // Check buyer cost 
        uint256 buyerConst = address(_buyer).balance;
        // Check player Status
        bool _player_status = playerStatus;

        bool all_status = false;
        if(_media_status && (buyerConst > _rental_fee) && _player_status){
            all_status = true;
        }
        return all_status;
    }
    //----------------Check Playlist, Buyer and Player is ready----------------//

    //----------------Get Rentail Lenght----------------//
    function getRentalLength() public view returns (uint) {
        return RentalDataList.length;
    }
    //----------------Get Rentail Lenght----------------//


    //----------------Get Rentail Data from specific index----------------//
    function getRental(uint _RentalId) public view returns (RentalData memory) {
        RentalData storage b1 = RentalStores[_RentalId];
        return b1;
    }
    //----------------Get Rentail Data from specific index----------------//

    //----------------Get Rentail Data from specific index----------------//
    function getRentalStatus(uint _RentalId) public view returns (RentalStatus) {
        RentalData storage b1 = RentalStores[_RentalId];
        return b1.rental_status;
    }
    //----------------Get Rentail Data from specific index----------------//

    //----------------Update Rentail status----------------//
    function updateRental(uint _RentalId, RentalStatus _Rental_Stauts)  public {
        RentalData storage b1 = RentalStores[_RentalId];
        RentalDataList[_RentalId].rental_status = _Rental_Stauts; 
        //Modify Rentail status Data
        b1.rental_status = _Rental_Stauts;
    }
    //----------------Update Rentail status----------------//

}
